import { Home, Following, Profile } from '~/pages';
const PublicRoutes = [
    {
        path: '/',
        name: 'Home',
        component: Home,
    },
    {
        path: '/following',
        name: 'Following',
        component: Following,
    },
    {
        path: '/profile',
        name: 'Profile',
        component: Profile,
    },
    {
        path: '/profile',
        name: 'Profile',
        component: Profile,
    },
];
const PrivateRoutes = [];
export { PublicRoutes, PrivateRoutes };
